import s from './addFictionPage.module.css'
import React, { useState } from "react";
import { useNavigate } from "react-router";

const AddFictionPage = (props) =>{
  const [form, setForm] = useState({
   name: "",
   position: "",
   level: "",
 });
 const navigate = useNavigate();

 // These methods will update the state properties.
 function updateForm(value) {
   return setForm((prev) => {
     return { ...prev, ...value };
   });
 }

  async function onSubmit(e) {
    e.preventDefault();

    // When a post request is sent to the create url, we'll add a new record to the database.
    const newPerson = { ...form };
    console.log(newPerson);
  }

  return(
    <div>
    <form onSubmit={onSubmit}>
           <div className="form-group">
              <label htmlFor="coverPhotoUrl">Photo url</label>
              <input type="text" className="form-control" id="photoUrl"/>
           </div>
           <div className="form-group">
             <label htmlFor="name">Name</label>
             <input type="text" className="form-control" id="name"/>
           </div>
           <div className="form-group">
             <label htmlFor="maker">Maker</label>
             <input type="text" className="form-control" id="maker"/>
           </div>
           <div className="form-group">
             <label htmlFor="genre">Genre</label>
             <input type="text" className="form-control" id="genre"/>
           </div>
           <div className="form-group">
             <label htmlFor="releaseDate">Release date</label>
             <input type="text" className="form-control" id="releaseDate"/>
           </div>
           <div className="form-group">
             <label htmlFor="description">Description</label>
             <input type="text" className="form-control" id="description"/>
           </div>
           <div className="form-group">
             <label htmlFor="type">Type</label>
             <input type="text" className="form-control" id="type"/>
           </div>
           <div className="form-group">
             <input type="submit" value="Create person" className="btn btn-primary"/>
           </div>
         </form>
    </div>
  )
}

export default AddFictionPage;
